import styled from "styled-components";
import ddd from '../images/coffeeImage/ddd.jpg'


export const HomeCollectionPlant = styled.div`
background: linear-gradient(to right, rgba(0,0,0,0), rgba(0,0,0,0)), url(${ddd});
  height: 50vh;
  display: flex;
  justify-content: space-between;
  padding: 0.2rem calc((100vw - 1000px) / 2);

  width: 100%;
`
